const RegisterPage = () => {

    return (
        <>
            <h1>REGISTER</h1>
            <Link to={'/'}>Main</Link>
            <Link to={'/register'}>register</Link>
            <Link to={'/login'}>login</Link>
            <Link to={'/task'}>task</Link>
        </>
    );
};

export default RegisterPage;
